import React, { Component } from 'react';
import ProductE from './ProductE';
import TitleE from './TitleE';

import  { ProductConsumer } from '../ContextE';




class ProductListE extends Component{
    
    render(){
        

        return(
             <React.Fragment>
                 <div className="py-5">
                    <div className="container">
                         <TitleE name ="Nos" title=" produits"/>
                         <div className="row">
                             <ProductConsumer>
                                  {value=>{
                                            return value.products.map(product => {
                                              return <ProductE key={product.id} product={product} />;
                                            })
                                   }}  
                               </ProductConsumer>
                         </div>
                    </div>
                </div>
            </React.Fragment>
          
        
        );
    }
}
export default ProductListE;
